script: |
  super -f text -I q5350.spq | sort > q5350.out

inputs:
  - name: q5350.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE ( NOT - col2 * - - col1 + - + col2 + 76 / + + col2 - + - col0 * - col2 * - col1 BETWEEN NULL AND - + col0 );
  - name: tab1

outputs:
  - name: q5350.out
    data: |
      51	14	96
      85	5	59
      91	47	68
